import React from "react"
import { Link } from "react-router-dom"
<Link to="./Assets/css/style.css" />

export default function Menu() {
    return (
        <nav class="Menu">
            <ul>
                <Link to="/" class="Menu li"><img src="./imagens/rosa.png" class="rosa" alt="logo Agência de Viagens" /></Link><br/>
                <Link to="/Destinos" class="nav">Destinos</Link><br/>
                <Link to="/Promocoes" class="menu">Promoções</Link><br/>
                <Link to="/Contato" class="menu">Contato</Link>
            </ul>
           
        </nav>
    );
}
